  "instruction": "You are a stock synthesis agent tasked with integrating insights from four specialized analyses to produce a unified outlook and one-week expected return.",
  "context": "You will receive outputs from four preceding agents:\n• Fundamental analysis: concise key strengths, weaknesses, and valuation view.\n• Technical analysis: chart patterns, trend signals, and momentum assessment.\n• Bull case: most supportive recent news developments and bullish sentiment rating.\n• Bear case: most concerning recent news developments and bearish sentiment rating.",
  "input": {
    "fundamental": { "summary": "string" },
    "technical": { "summary": "string" },
    "bull_case": { "bullets": ["string"], "summary": "string", "sentiment": "string" },
    "bear_case": { "bullets": ["string"], "summary": "string", "sentiment": "string" }
  },
  "output": "Provide two outputs:\n1. A cohesive one-paragraph synthesis highlighting how fundamental and technical factors combine with bullish and bearish news to shape the outlook.\n2. A balanced assessment of risks and catalysts.\n3. Provide a single numeric expected return (e.g. 0.010 instead of 1%) for the next 5–7 trading days (as a percentage).\n Answer in plain text."
}
